commits.content:
import { Poppins } from "next/font/google";
import { ThemeProvider } from "next-themes";
import AuthProvider from "@/components/AuthProvider";
import AuthHolder from "@/components/AuthHolder";
import { Metadata } from "next";
import { PrimeReactProvider } from "primereact/api";
import 'primereact/resources/themes/lara-light-indigo/theme.css';
import 'primeicons/primeicons.css';
import "./globals.css";
import { CalenderProvider } from "@/components/context/CalenderProvider";
import { DashboardProvider } from "@/components/context/Dashboardprovider";


const poppins = Poppins({
  weight: ["100", "200", "300", "400", "500", "900"],
  subsets: ["latin"],
});
export const metadata: Metadata = {
  title: "Sign in",
  description: "Sign In To Dashboard",
};

export default function RootLayout({
  children,
}: Readonly<{
  children: React.ReactNode;
}>) {
  return (
    <html lang="en">
      <body className={`min-h-screen ${poppins.className}`}>
        <ThemeProvider attribute="class" defaultTheme="light">
          <AuthHolder>
            <AuthProvider>
              <PrimeReactProvider>
                <CalenderProvider>
                  <DashboardProvider>
                    {children}
                  </DashboardProvider>
                </CalenderProvider>
              </PrimeReactProvider>
            </AuthProvider>
          </AuthHolder>
        </ThemeProvider>
      </body>
    </html>
  );
}
